import React from 'react';
import { Icon } from '../../icon';
import SearchItem from '../searcItem.json';

const SearchItemUser = () => {
    return (
        <>
            {SearchItem.map((search) => (
                <div key={search.id} className='px-6 flex justify-between items-center py-2 cursor-pointer duration-150 ease-in-out hover:bg-[#fafafa]'>
                    <div className='flex items-center'>
                        <img src={search.image} className='w-14 h-14 object-contain rounded-full' alt='' />
                        <div className='flex flex-col ml-3'>
                            <span className='text-sm font-semibold'>{search.title}</span>
                            <span className='text-[#8f8f8f] font-normal text-sm'>{search.description}</span>
                        </div>
                    </div>
                    <span className='cursor-pointer text-[#8e8e8e]'>
                        <Icon name="close" size={16} />
                    </span>
                </div>
            ))}
        </>
    );
};

export default SearchItemUser;
